import { Tabs } from "@mantine/core";
import React from "react";
import { useNavigate } from "react-router-dom";
import ProfileSettings from "./ProfileSettings";
import Reviews from "./ReviewCard";
import { IconMessage, IconSettings, IconLogout } from "@tabler/icons";

const UserProfile = ({ currentUser }) => {
  const navigate = useNavigate();
  const handleLogout = () => {
    fetch("http://127.0.0.1:3000/logout", {
      method: "DELETE",
    }).then(() => {
      navigate("/");
    });
  };

  return (
    <>
      <Tabs grow>
        <Tabs.Tab
          icon={<IconSettings strokeWidth={1.25} />}
          label="Profile Settings"
        >
          {<ProfileSettings />}
        </Tabs.Tab>
        <Tabs.Tab icon={<IconMessage strokeWidth={1.25} />} label="My Reviews">
          {<Reviews />}
        </Tabs.Tab>
        <Tabs.Tab
          icon={<IconLogout onClick={handleLogout} strokeWidth={1.25} />}
        />
        {/* <Tabs.Tab label="Profile Settings"></Tabs.Tab> */}
      </Tabs>
    </>
  );
};

export default UserProfile;
